    password: '123',
    email: 'test',
  });

  useEffect(() => {
    const fetchData = async () => {
      const { data } = await axios.get('/users');

      setUsers(data);
    };

    fetchData();
  }, []);

  return (
    <div className="wrapper">
      <ListUsers users={users} />
    </div>
  );
};

export default Admin;
